import React from 'react';
import Footer from './footer';
const Site = () => {
       return (
        <div>
            <div className="area1">
                Area 1 Content
            </div>
            <div className="area2">
                Area 2 Content
            </div>
            <div className="area3">
                Area 3 Content
            </div>
            <div className="area4">
                Area 4 Content
            </div>
            <footer>
               <Footer></Footer>
            </footer>
        </div>
    );
}

export default Site;
